import React from 'react'
import Sidebars from '../layout/dashboard/Sidebars'
import HiringFunnel from './HiringFunnel';

const HiringFunnelPage = () => {
  return (
    <div>
      <Sidebars>
        <HiringFunnel />
      </Sidebars>
    </div>
  )
}

export default HiringFunnelPage
